import styled from "styled-components"

export const StyledList = styled.ul`
  list-style: none;
  padding: 0;
  margin: 0;
  display: flex;
  flex-direction: column;
  flex-grow: 2;
  width: 50%;
  border: 1px solid black;
  max-height: 100%;
`
